export class PaymentOrder {
  // tslint:disable-next-line:variable-name
  customer_username: string;
  // tslint:disable-next-line:variable-name
  package_name: string;
  // tslint:disable-next-line:variable-name
  package_id: number;
  // tslint:disable-next-line:variable-name
  package_type: string;
  // tslint:disable-next-line:variable-name
  total_price: any;
  // tslint:disable-next-line:variable-name
  package_price: any;

  shipping: any;
  // tslint:disable-next-line:variable-name
  tax_price: any;
}
